import React from 'react';

import { Button, ButtonToolbar } from 'react-bootstrap';

function User() {

  const buttons = (

    <div>

      <ButtonToolbar>

        <Button bsStyle="primary">Primary</Button>

      </ButtonToolbar >

    </div>

  );


  return buttons;
}

export default User;
